import React from "react";
import styled from "styled-components";


function Postagens() {
  return ( <CriarPostContainer>
    <h2>Crie uma nova postagem</h2>
    <button>Nova Postagem</button>
</CriarPostContainer>)
}




const CriarPostContainer = styled.section`
  margin: 20px; 
  padding: 15px;
  background: #89A8B2;
  border-radius: 8px;
  text-align: center;
  width: 100vw; 
  max-width: 600px; 
  height: auto; 
  overflow: hidden; 
  box-sizing: border-box;

  button {
    padding: 10px;
    border: none;
    background: #2D2D34;
    color: white;
    border-radius: 5px;
    cursor: pointer;
  }
`;

export default Postagens;
